var app = angular.module("app", ['ngPagination']);

app.controller('MainController', function ($scope, $http) {
    $scope.formData = {};
    $http.get('/api/all')
        .success(function (data) {

            $scope.post = data;
            console.log(data)
        })
        .error(function (data) {
            console.log('Error: ' + data);
        });
    

    $scope.createTodo = function () {
        $http.post('/api/posts', $scope.formData)
            .success(function (data) {

                $scope.formData = {}
                $scope.posts = data;
                console.log(data);
            })
            .error(function (data) {
                coslole.log('error: ' + data);
                coslole.log('error22222');
            });

    };
    $scope.deletePost = function (id) {
        
        $http.delete('/api/post/' + id)
            .success(function (data) {
                $scope.post = data;
                console.log(data);
            })
            .error(function (data) {
                console.log('Error: ' + data)
            });
    };
});
app.controller('search', function ($scope,$http) {
     $http.get('/search_params')
        .success(function (data) {

            $scope.post = data;
            console.log('data')
        })
        .error(function (data) {
            console.log('Error: ' + data);
        });
    
});
